import styled from 'styled-components'

const OuterContainer = styled.div`
  background: black;
`
const AboutContainer = styled.div`
  margin: 0 auto;
  max-width: 1100px;
  padding: 0;
`

const ProfilePicture = styled.img`
  margin: 0 auto;
  height: calc(100vh - 60px);
  width: 100%;
  max-height: 100vh;
  object-fit: cover;
  object-position: 100% 0;
  padding: 0;
`

const Introduction = styled.h1`
  color: white;
`

const About = () => {
  return (
    <OuterContainer>
    <AboutContainer>
      <ProfilePicture src = {require('../content/img/igdp.jpg').default}/>
      <Introduction>
        Hi, I am Sashank!
      </Introduction>
    </AboutContainer>
    </OuterContainer>
  )
}

export default About
